import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, useNavigate, Link } from 'react-router-dom';
import { Container, Row, Col, Card, Button, Navbar, Nav, Modal, Form, FormControl } from 'react-bootstrap';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const vehicles = [
  // Add vehicles data
  { id: 1, title: 'Ford Mustang', type: 'Coupe', price: 150, image: 'https://th.bing.com/th?id=OIP.ZeAIrQqrtFQcpJ8TZGEHHAHaE8&w=306&h=204&c=8&rs=1&qlt=90&o=6&dpr=1.1&pid=3.1&rm=2' },
  { id: 2, title: 'Tesla Model S', type: 'Sedan', price: 200, image: 'https://th.bing.com/th/id/OIP.khB7mYDhxl-GBTasq8jdgQHaEo?w=282&h=180&c=7&r=0&o=5&dpr=1.1&pid=1.7' },
  { id: 3, title: 'Bentley', type: 'Hatchback', price: 300, image: 'https://th.bing.com/th/id/OIP.JE95-LvOzm63nEEU_8-RJAHaEe?w=258&h=180&c=7&r=0&o=5&dpr=1.1&pid=1.7' },
  { id: 4, title: 'Yamaha', type: 'SZ25', price: 400, image: 'https://th.bing.com/th/id/OIP.4ZEJiBMOCFgHSu6Zv_jwHQHaFj?w=227&h=180&c=7&r=0&o=5&dpr=1.1&pid=1.7' },
  { id: 5, title: 'Kawasaki Ninja', type: 'ZX-10R', price: 400, image: 'https://th.bing.com/th/id/OIP.Q0ulbHEWMmRmEZzW7U1XMgHaE8?w=214&h=180&c=7&r=0&o=5&dpr=1.1&pid=1.7' },
  { id: 6, title: 'Luton Van', type: 'Crew', price: 400, image: 'https://th.bing.com/th/id/OIP.KA7NBpJI2D5UiPuQ_51HmQHaE2?w=252&h=180&c=7&r=0&o=5&dpr=1.1&pid=1.7' },
  { id: 7, title: 'Chevrolet Silverado', type: 'Truck', price: 180, image: 'https://th.bing.com/th/id/OIP.D7PuAimNiYUNifHUMhmLFwAAAA?w=262&h=180&c=7&r=0&o=5&dpr=1.1&pid=1.7https://th.bing.com/th/id/OIP.SFbJoqGVqWeU_GK6Foh4gQHaFF?w=258&h=180&c=7&r=0&o=5&dpr=1.1&pid=1.7' },
  { id: 8, title: 'Ram 1500', type: 'Truck', price: 190, image: 'data:image/jpeg;base64,' },
  { id: 9, title: 'Dodge Grand Caravan', type: 'Van', price: 100, image: 'data:image/jpeg;base64,' },
  
];

const VehicleCard = ({ vehicle, onSelect }) => (
  <Col md={4} className="mb-4">
    <Card>
      <Card.Img className="card-img" variant="top" src={vehicle.image} alt={vehicle.title} />
      <Card.Body>
        <Card.Title>{vehicle.title}</Card.Title>
        <Card.Text>Type: {vehicle.type}</Card.Text>
        <Card.Text>Price: ${vehicle.price}/day</Card.Text>
        <Button variant="primary" onClick={() => onSelect(vehicle)}>Select Vehicle</Button>
      </Card.Body>
    </Card>
  </Col>
);

const VehicleRentalSystem = ({ setBookedVehicles }) => {
  const [filteredVehicles, setFilteredVehicles] = useState(vehicles);
  const [selectedVehicle, setSelectedVehicle] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [startDate, setStartDate] = useState(null);
  const [endDate, setEndDate] = useState(null);
  const [searchQuery, setSearchQuery] = useState('');
  const [priceFilter, setPriceFilter] = useState('all');
  const navigate = useNavigate();

  const handleFilter = () => {
    let filtered = vehicles;

    if (searchQuery) {
      const query = searchQuery.toLowerCase();
      filtered = filtered.filter(vehicle =>
        vehicle.title.toLowerCase().includes(query)
      );
    }

    if (priceFilter !== 'all') {
      const price = parseInt(priceFilter);
      filtered = filtered.filter(vehicle => vehicle.price <= price);
    }

    setFilteredVehicles(filtered);
  };

  const handleDateChange = (date, setter) => setter(date);

  const handleConfirm = () => {
    if (selectedVehicle) {
      setBookedVehicles(prev => [
        ...prev,
        {
          ...selectedVehicle,
          startDate,
          endDate
        }
      ]);
    }
    setShowModal(false);
    navigate('/confirmation');
  };

  const handleSelectVehicle = (vehicle) => {
    setSelectedVehicle(vehicle);
    setShowModal(true);
  };

  return (
    <Container className="home-page">
      <h1 className="my-4">Vehicle Rental System</h1>
      <Form className="d-flex mb-4">
        <FormControl 
          type="text" 
          placeholder="Search for a vehicle" 
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          className="mr-2"
        />
        <Form.Select
          value={priceFilter}
          onChange={(e) => setPriceFilter(e.target.value)}
          className="mr-2"
        >
          <option value="all">All Prices</option>
          <option value="100">Up to $100/day</option>
          <option value="200">Up to $200/day</option>
          <option value="300">Up to $300/day</option>
          <option value="400">Up to $400/day</option>
        </Form.Select>
        <Button variant="outline-success" onClick={handleFilter}>Search</Button>
      </Form>
      <Row>
        {filteredVehicles.map(vehicle => (
          <VehicleCard key={vehicle.id} vehicle={vehicle} onSelect={handleSelectVehicle} />
        ))}
      </Row>
      <Modal show={showModal} onHide={() => setShowModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Rental Details</Modal.Title>
        </Modal.Header>
        <Modal.Body className="modal-body">
          {selectedVehicle && (
            <div>
              <Card>
                <Card.Img className="card-img" variant="top" src={selectedVehicle.image} alt={selectedVehicle.title} />
                <Card.Body>
                  <Card.Title>{selectedVehicle.title}</Card.Title>
                  <Card.Text>Type: {selectedVehicle.type}</Card.Text>
                  <Card.Text>Price: ${selectedVehicle.price}/day</Card.Text>
                  <Card.Text>
                    <DatePicker
                      selected={startDate}
                      onChange={(date) => handleDateChange(date, setStartDate)}
                      selectsStart
                      startDate={startDate}
                      endDate={endDate}
                      placeholderText="Select start date"
                    />
                    {' to '}
                    <DatePicker
                      selected={endDate}
                      onChange={(date) => handleDateChange(date, setEndDate)}
                      selectsEnd
                      startDate={startDate}
                      endDate={endDate}
                      minDate={startDate}
                      placeholderText="Select end date"
                    />
                  </Card.Text>
                  <Button variant="success" onClick={handleConfirm}>Confirm Rental</Button>
                </Card.Body>
              </Card>
            </div>
          )}
        </Modal.Body>
      </Modal>
    </Container>
  );
};

const ConfirmationPage = ({ bookedVehicles }) => (
  <Container className="confirmation-page text-center my-5">
    <h1>Booked Successfully!</h1>
    <p>Your vehicle rental has been confirmed.</p>
  </Container>
);

const PastBookings = ({ bookedVehicles }) => (
  <Container className="past-bookings-page">
    <h1 className="my-4">Past Bookings</h1>
    <Row>
      {bookedVehicles.length === 0 ? (
        <p>No bookings found.</p>
      ) : (
        bookedVehicles.map((booking, index) => (
          <Col md={4} className="mb-4" key={index}>
            <Card>
              <Card.Img className="card-img" variant="top" src={booking.image} alt={booking.title} />
              <Card.Body>
                <Card.Title>{booking.title}</Card.Title>
                <Card.Text>Type: {booking.type}</Card.Text>
                <Card.Text>Price: ${booking.price}/day</Card.Text>
                <Card.Text>Start Date: {booking.startDate.toLocaleDateString()}</Card.Text>
                <Card.Text>End Date: {booking.endDate.toLocaleDateString()}</Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))
      )}
    </Row>
  </Container>
);

const LocationPage = () => (
  <Container className="location-page">
    <h2>Our Location</h2>
    <div style={{ width: '100%', height: '500px' }}>
      <iframe
        title="Google Maps"
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3151.835434508618!2d144.95373631531784!3d-37.81627974202161!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6ad65d43f1f98e13%3A0x5045675218ce6e0!2sMelbourne%20VIC%2C%20Australia!5e0!3m2!1sen!2sus!4v1619927753746!5m2!1sen!2sus"
        width="100%"
        height="100%"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
      ></iframe>
    </div>
  </Container>
);

function App() {
  const [bookedVehicles, setBookedVehicles] = useState([]);

  return (
    <Router>
      <Navbar bg="dark" variant="dark" expand="lg">
        <Container fluid>
          <Navbar.Brand as={Link} to="/" className="mr-auto">Vehicle Rental</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mx-auto">
              <Nav.Link as={Link} to="/" className="nav-link-custom">Home</Nav.Link>
              <Nav.Link as={Link} to="/past-bookings" className="nav-link-custom">Past Bookings</Nav.Link>
              <Nav.Link as={Link} to="/location" className="nav-link-custom">Location</Nav.Link>
            </Nav>
            
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Routes>
        <Route path="/" element={<VehicleRentalSystem setBookedVehicles={setBookedVehicles} />} />
        <Route path="/past-bookings" element={<PastBookings bookedVehicles={bookedVehicles} />} />
        <Route path="/location" element={<LocationPage />} />
        <Route path="/confirmation" element={<ConfirmationPage bookedVehicles={bookedVehicles} />} />
      </Routes>
    </Router>
  );
}

export default App;

